/* ---------------------------------------------------------------demand_deposit_account-------------------------------------------------------------------------- */

create table demand_deposit_account (
	id VARCHAR(40),
	state VARCHAR(50),
	created_user VARCHAR(50),
	created_date VARCHAR(50),
	customer_number VARCHAR(50),
	account_number VARCHAR(50),
	status VARCHAR(50),
	currency VARCHAR(3),
	overdraft_limit DECIMAL(8,2),
	balance DECIMAL(12,2)
);



/* ---------------------------------------------------------------saving_deposit_account-------------------------------------------------------------------------- */


create table saving_deposit_account (
	id VARCHAR(40),
	state VARCHAR(50),
	created_user VARCHAR(50),
	created_date VARCHAR(50),
	customer_number INT,
	account_number VARCHAR(50),
	status VARCHAR(50),
	currency VARCHAR(3),
	balance DECIMAL(12,2),
	interest DECIMAL(8,2)
);


/* ---------------------------------------------------------------time_deposit_account-------------------------------------------------------------------------- */

create table time_deposit_account (
	id VARCHAR(40),
	state VARCHAR(50),
	created_user VARCHAR(50),
	created_date VARCHAR(50),
	customer_number INT,
	account_number VARCHAR(50),
	status VARCHAR(50),
	currency VARCHAR(3),
	balance DECIMAL(12,2),
	maturity VARCHAR(3),
	interest DECIMAL(6,2)
);
